import { GridList } from "@material-ui/core";
import { Component } from "react";
import Item from "../../components/cart-item/Item";
import "./Home.css"

const tileData = [
    {
        image: "./cart.jpeg",
        tile: 'test title'
    }
];

class Home extends Component {

    render() {
        return (
            <div className="grid-container">
                <GridList cols={3}>
                    {
                        tileData.map(data =>
                            <ul>
                                <Item cart={data.image}></Item>
                            </ul>
                        )
                    }
                </GridList>
            </div>
        );
    }
}

export default Home;
